[{"location":"","page":"Home","title":"Home","text":"CurrentModule = SetBuilders","category":"page"},{"location":"#SetBuilders","page":"Home","title":"SetBuilders","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Documentation for SetBuilders.","category":"page"},{"location":"","page":"Home","title":"Home","text":"","category":"page"},{"location":"","page":"Home","title":"Home","text":"Modules = [SetBuilders]","category":"page"},{"location":"#SetBuilders.@setbimap-Tuple{Any, Any, Any, Vararg{Any}}","page":"Home","title":"SetBuilders.@setbimap","text":"A bidirectionally mapped set builder     struct MyStruct         a     end\n\nA = @setbimap(y in MyStruct, x -> MyStruct(x), y -> y.a, x in SB_SET_INT)\n\nis similar to the mathematical set definiton of \n\nA = {y ∈ MyStruct | y = MyStruct(x) and x = y.a where x ∈ I}\n\n, where I is the integer set and MyStruct is the all possible\nMyStruct objects. SB_SET_INT is a pre-defined set in SetBuilders.jl\npackage for Julia integer data type.\n\n\n\n\n\n","category":"macro"},{"location":"#SetBuilders.@setfilter-Tuple{Any, Any, Vararg{Any}}","page":"Home","title":"SetBuilders.@setfilter","text":"A filtered set builder\n\nA = @setfilter((x in SB_SET_INT64, y in SB_SET_INT64), x > 0 && y > 0)\n\nis similar to the mathematical set definiton of \n\nA = {x ∈ I, y ∈ I | x > 0 and y > 0}\n\n, where I is the integer set. SB_SET_INT64 is a pre-defined set\nin SetBuilders.jl package for Julia Int64 data type.\n\n\n\n\n\n","category":"macro"}]
